  const price = props.price;
  const desc = props.desc;
  const image = props.image

  return (
    <div className="SingleProductPage-Home">
      <Nav />
      <div className="SingleProductPage-Container">
        <a href="#">
          {' '}
          <img
            className="SingleProductPage-Mainimg"
            src={image}
          />
        </a>
        <div className="SingleProductPage-Content">
          <span className="SingleProductPage-Title">{name}</span>
          <span className="SingleProductPage-Price">${price}</span>
          <button className="SingleProductPage-button">ADD TO CART</button>
          <span className="SingleProductPage-desc">
            
          </span>
        </div>
      </div>
    </div>
  )
}

export default SingleProductPage
